    "## load ggplot2\n",
    "\n",
    "library(ggplot2)\n",
    "library(ggthemes)\n",
    "\n",
    "ggplot(train, aes(Pclass, fill = factor(Survived))) +\n",
    "  geom_bar() +\n",
    "  xlab(\"Passenger Class\") + \n",
    "  labs(fill = \"Survived\") +\n",
    "  ggtitle(\"Survival Count Across Passenger Class\") +\n",
    "  theme_clean()"
   ]
