   "source": [
    "# create a title extraction function to expand the relationship between\n",
    "# Pclass and Survived \n",
    "\n",
    "Title_func <- function(name) {\n",
    "  case_when(\n",
    "    str_detect(name, \"Miss.\") ~ \"Miss.\",\n",
    "    str_detect(name, \"Mrs.\") ~ \"Mrs.\",\n",
    "    str_detect(name, \"Mr.\") ~ \"Mr.\",\n",
    "    str_detect(name, \"Master.\") ~ \"Master\",\n",
    "    TRUE ~ \"other\"\n",
    "  )\n",
    "}"
   ]
  },
