   "source": [
    "# create a null vector. \n",
    "\n",
    "titles <- NULL\n",
    "\n",
    "for (i in 1:nrow(train_test_combined)) {\n",
    "  titles <- c(titles, Title_func(train_test_combined[i, \"Name\"]))\n",
