    "# most of the missing values are in the train data\n",
    "# visualise age and survival rate by and Sex Pclass\n",
    "\n",
    "ggplot(train, aes(Age, fill = factor(Survived))) +\n",
    "  geom_histogram(binwidth = 5) +\n",
    "  facet_wrap(~ Sex ~ Pclass) +\n",
    "  xlab(\"Age\") + \n",
    "  ylab(\"Total Count\") +\n",
    "  theme_classic()\n",
    "  "
   ]
