    "# since the max age for boy child is around 14, let's filter for \n",
    "# misses_alone with age lower than 14 to get the children misses\n",
    "\n",
    "misses_alone %>% \n",
    "  filter(Age < 14.5) %>% \n",
    "  summarise(Children = n())"
   ]
