   "source": [
    "# visualise SibSp and survival rate by Pclass and title\n",
    "\n",
    "train_test_combined %>% \n",
    "  filter(Survived != \"none\") %>% \n",
    "ggplot(aes(SibSp)) +\n",
    "  geom_bar(aes(fill = Survived)) +\n",
    "  facet_wrap(~ Pclass ~ Title) +\n",
    "  ylim(0,300) +\n",
    "  xlab(\"SibSp\") +\n",
    "  ylab(\"Total count\") +\n",
    "  ggtitle(\"Survival rate by SibSp, Pclass and Titles\") "
   ]
