    "# visualise the Parch variable \n",
    "\n",
    "train_test_combined %>% \n",
    "  filter(Survived != \"none\") %>% \n",
    "  ggplot(aes(Parch)) +\n",
    "  geom_bar(aes(fill = Survived)) +\n",
    "  facet_wrap(~ Pclass ~ Title) +\n",
    "  ylim(0,300) +\n",
    "  xlab(\"Parch\") +\n",
    "  ylab(\"Total count\") +\n",
    "  ggtitle(\"Survival rate by SibSp, Pclass and Titles\")\n",
    "  "
   ]
