    "# visualise survival by family size \n",
    "\n",
    "train_test_combined %>% \n",
    "  filter(Survived != \"none\") %>% \n",
    "  ggplot(aes(Family_size)) +\n",
    "  geom_bar(width = 1, aes(fill = Survived)) +\n",
    "  facet_wrap(~ Pclass ~ Title) +\n",
    "  xlab(\"Family Size\") +\n",
    "  ylab(\"Total count\") +\n",
    "  ggtitle(\"Survival by Family Size by Pclass and Title\")"
   ]
