    "# More predictive answer\n",
    "\n",
    "train_test_combined %>% \n",
    "  filter(Survived != \"none\") %>% \n",
    "ggplot(aes(cab_first_char, fill = Survived)) +\n",
    "  geom_bar() +\n",
    "  facet_wrap(~ Pclass ~ Title) +\n",
    "  ggtitle(\"Cabin First Char and Survival Rate\") +\n",
    "  ylim(0,300)"
   ]
