   "source": [
    "# random forest on Pclass and title\n",
    "\n",
    "rf_label <- as.factor(train$Survived)\n",
    "\n",
    "set.seed(200)\n",
    "\n",
    "rd_train <- train_test_combined[1:891, c('Pclass', 'Title')]\n",
    "\n",
    "predict1 <- randomForest(x = rd_train, y = rf_label,\n",
    "                         importance = TRUE, ntree = 500)\n",
    "\n",
    "predict1\n",
    "\n",
    "varImpPlot(predict1)"
   ]
